import React from "react";
import Head from "next/head";
import { Card, Space } from "antd";
import AppLayout from "../components/AppLayout";

const Home = () => (
  <AppLayout>
    <Head>
      <title>NTB</title>
    </Head>
    <Space direction="vertical" size={16}>
      <Card
        title="Default size card"
        extra={<a href="#">More</a>}
        style={{
          width: 300,
        }}
      >
        <p>Card content</p>
        <p>Card content</p>
        <p>Card content</p>
      </Card>
      <Card
        size="small"
        title="Small size card"
        extra={<a href="#">More</a>}
        style={{
          width: 300,
        }}
      >
        <p>Card content</p>
        <p>Card content</p>
        <p>Card content</p>
      </Card>
    </Space>
  </AppLayout>
);

export default Home;
